 unit. \n Lockout $50\/Lost Key $100 plus cost to change hardware.\nNoise levels are to be kept to a cozy medium.\nWe are all legal eagles, while in the nest, no illegal or suspicious activities\/behavior.\nNo fighting.\n-If you encounter any issues during your stay, please let us know as soon as possible.\nWhen you get ready to empty nest at check-out: .....leave nest as-was upon arrival. .....remove bed linens place in bin for soiled item, we will wash on your behalf .....leave any soiled towels in bin for soiled items, we will wash too. .....wash dishes you used. .....sweep.vacuum.mop floors if excessively dirty. .....takeout all trash, dumpster is on other side of wooden fence. .....tidy up after yourself.\nOther things to consider:\nIn rare instances there could be a preventable delay in check-in, in such instances we will notify you as soon as we for see an issue that will interfere with your scheduled check-in time. We will also offer some type of amends  for the inconvenience.\n-Due to same day check-outs & check-in, we generally are not able to accommodate late check-outs. However, you may inquire at least 48 hours prior to your check out date to see if late check-out is available.  Late check out without prior approval will result in an $20 fee for each additional 15 minute interval over check-out time.\nPlease helps us in our efforts to keep the unit pest-free, by being mindful of behaviors that attract pest (dropping\/leaving food items, not taking out the trash, leaving doors\/windows open, bring items in\/around the unit that may already contain pest and etc.). We take great pride in reducing the risk of having pest in the unit by pest control, regular trash removal, cleanliness, and etc, but can\'t guarantee a 100% pest free zone due to issues out of our control.","cleaning_fee_native":0,"extras_price_native":0,"security_deposit_native":250,"security_price_native":250,"security_deposit_formatted":"$250","description":"Nest - n. a snug, comfortable place; cozy residence or situation; a retreat or place of habitual resort. \n\nWELCOME to The Blue Nest @ Dargan, nestled just off the branch of I20 along the neighborhood border of the West End, a vibrant & upward-trending neighborhood in the ATL, and perfectly located to soar into all that Atlanta and the surrounding areas has to offer.\n\nThe nest, a one bedroom apartment, quaint but newly refurbish; and of course snug & cozy yet golden, makes it the perfect retreat to experience, featuring a charming kitchen for feeding, an inviting great room to rest your tail-feathers, with a plush queen size bed for roosting and a refreshing bathroom for your birdbath & singing!\n\nWe are NOT the Burb\u2019s but the birds! You will have complete privacy within the nest, but please, please feel free to text, call, and peck or chirp if you need anything. We soar to delight!\n\nFor those looking to bury their head in the nest to just relax around the coop -or- those wanting to be loose as a goose and fly the coop to maybe shake a tail feather, this area is for you! \n\nAtlanta\u2019s West End is vibrant urban communities, among today\'s upward-trending neighborhoods in Atlanta. The area brings together the perfect twigs for the conveniences of in-town living with a touch of southern hospitality and a dash of old-fashioned neighborliness with strong historic roots.  You will find an array of birds from many different trees of life here, including a few rare birds and lame ducks, we span different economic, cultural, ethnic and religious backgrounds, so you will fit right in.\n\nIf you opt not to fly, our favorite is walking and uber, you can get a lyft too; bus lines are a peck away, so are the West End and Ashby Marta lines. Bike & scooter share terminals are nearby.\n\nI20 runs through the heart of the area, the connector of I75 & I85 along with loop 285 are nearby too.\n\nHartfield Jackson Airport (ATL), Greyhound, Megabus, & Amtrak are all just a peck away","description_locale":